import Imagem from './Imagem';


const Imagens = [
    'data:image/jpeg;base64,',
    'https://i1.sndcdn.com/artworks-v2JOIv0Hs8Qx9Xxx-4T5lNQ-t500x500.jpg',
    'https://i.ytimg.com/vi/nAQFhNtyluk/maxresdefault.jpg',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://a.espncdn.com/combiner/i?img=/i/teamlogos/soccer/500/874.png',
];

function Galeria() {
    return(
        <div className="galeria">
            {Imagens.map((url, index) => (
                <Imagem key={index} url={url}/>

            ))}
        </div>
    )
}

export default Galeria;